<p>本文apk下载地址：<a href="https://azrng.lanzouv.com/iBQRe0eeg8wf" target="_blank" rel="noopener noreferrer">https://azrng.lanzouv.com/iBQRe0eeg8wf</a> ，内容很简单，一个时间轴以及一个点击按钮切换背景图的东西，时间轴是学习Masa Blazor教程的，背景图的接口还是网上白嫖的，重点学习发布了apk，下面来简单介绍一下我的发布步骤吧</p>
